import React from 'react'
import FacebookLogo from './../../assets/facebook-logo-white.png'
import LinkedInLogo from './../../assets/linkedin-logo-white.png'
import GithubLogo from './../../assets/github-logo-white.png'
const LinkFooter = (props) =>
{
    return (
        <div style={{height: 100}} className='bg-mid-gray flex w-100 justify-center'>
            <div className='flex center'><img src={FacebookLogo} 
                alt='facebook logo' className='grow ma2 pointer'
                width='64px' height='auto'></img></div>
            <div><img src={LinkedInLogo} 
                alt='facebook logo' className='grow ma2 pointer'
                width='64px' height='auto'></img></div>
            <div><img src={GithubLogo} 
            alt='facebook logo' className='grow ma2 pointer' 
            width='64px' height='auto'></img></div>
        </div>
    );
}

export default LinkFooter;
